import React, { useState } from 'react';

const mockParkingLots = {
    "Hammond Campus": ["Parking Lot 1", "Parking Lot 2", "Parking Garage A"],
    "Westville Campus": ["Parking Lot B", "Parking Lot C", "Overflow Lot"],
};

function ParkingSuggestion() {
    const [location, setLocation] = useState('');
    const [parkingLots, setParkingLots] = useState([]);

    const handleSearch = () => {
        const lots = mockParkingLots[location] || ["No parking lots found for this location."];
        setParkingLots(lots);
    };

    return (
        <div style={{ padding: 20 }}>
            <h2>Find Parking Lots</h2>
            <input
                type="text"
                placeholder="Enter event location (e.g., Hammond Campus)"
                value={location}
                onChange={e => setLocation(e.target.value)}
                style={{ marginRight: '10px' }}
            />
            <button onClick={handleSearch}>Find Parking</button>

            <ul>
                {parkingLots.map((lot, index) => (
                    <li key={index}>{lot}</li>
                ))}
            </ul>
        </div>
    );
}

export default ParkingSuggestion;
